// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Counter {
    uint public count = 1;
    uint256 public count256 = 1;
    int public anycount = 1;
    string public letters = "Hellow smart!";
    bytes32 public myBytes = "hello again, no idea about bytes";

    address public myAdress = 0x8473Be67C1E951fa0428d28140DbeECab7052b84;

    struct myStruct{
        int num;
        string words;
    }

    myStruct public StructWorking = myStruct(5,"hello nj");
}

